import React, { useState } from "react";
import { signIn } from "../services";
import { useNavigate } from "react-router-dom";

const SignIn = ({ onLoggedIn }) => {
  const navigate = useNavigate();
  const [signInError, setSignInError] = useState();
  const [signInInput, setSignInInput] = useState({
    email: "",
    password: "",
  });

  const _handleChange = (e) => {
    const inputTarget = e.target.value;
    const inputName = e.target.name;
    setSignInInput({
      ...signInInput,
      [inputName]: inputTarget,
    });
  };

  const onSignedIn = (user) => {
    onLoggedIn(user);
    navigate("/calendar");
  };

  const onError = (error) => {
    setSignInError(error);
  };

  const handleSignIn = (e) => {
    e.preventDefault();
    signIn({ user: signInInput, onSignedIn, onError });
  };

  return (
    <div className="postion">
      <div className="col-md-10 mx-auto col-lg-5 rounded-5 mt-5 usersForm animate__animated animate__fadeInUp animate__faster">
        <h2 className="mb-3 mt-3 px-5 py-5">Sign In</h2>
        <form onSubmit={handleSignIn}>
          <div className="px-5">
            <div className="input-container ">
              <input
                name="email"
                type="email"
                value={signInInput.email}
                onChange={_handleChange}
                className="form-control mb-3 "
              />
              <label className={signInInput.email && "filled"}>Email</label>
            </div>
            <div className="input-container ">
              <input
                name="password"
                type="password"
                value={signInInput.password}
                onChange={_handleChange}
                className="form-control mb-3 "
              />
              <label className={signInInput.password && "filled"}>
                Password
              </label>
              {signInError ? (
                <p className="error-message">{signInError}</p>
              ) : null}
            </div>
          </div>

          <div className="py-5 px-5">
            <button className="boton">Sign In</button>
          </div>
        </form>
        <div>
          <svg
            className="svg"
            width={906}
            height={696}
            viewBox="0 0 906 696"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
          >
            <g opacity="0.9">
              <rect
                x="905.049"
                y="130.7"
                width="572.073"
                height="824.82"
                transform="rotate(99.1175 905.049 130.7)"
                fill="url(#pattern0)"
              />
            </g>
            <defs>
              <pattern
                id="pattern0"
                patternContentUnits="objectBoundingBox"
                width={1}
                height={1}
              >
                <use
                  xlinkHref="#image0_104_4411"
                  transform="scale(0.00074129 0.000514139)"
                />
              </pattern>
              <image
                id="image0_104_4411"
                width={1349}
                height={1945}
                xlinkHref="data:image/png;base64,"
              />
            </defs>
          </svg>
        </div>
      </div>
    </div>
  );
};

export default SignIn;
